(1, 'About Us  new text', '&lt;p&gt;&lt;p&gt;&lt;/p&gt;&lt;p&gt;&lt;/p&gt;&lt;p&gt;&lt;/p&gt;&lt;p&gt;&lt;/p&gt;&lt;h1&gt;&lt;b&gt;Abut us!&lt;/b&gt;&lt;/h1&gt;\r\n&lt;img src=&quot;data:image/png;base64,&quot; style=&quot;width: 456px; float: right;&quot; data-filename=&quot;target-results1-removebg-preview.png&quot; class=&quot;note-float-right&quot;&gt;Global Institute for Human Capital Development (GIHCD) is a Melbourne, Australia-based organization committed to developing talents across the world. It exists to offer global learning events, professional certification, awards, research, and advocacy. At Global Institute, we thrive for the word- extraordinary! Our aim is to become the pinnacle of standards for the field of Learning and Development. We assess and aid facilitators to actualize the highest potential. We help people and organizations quickly learn the essential skills that learning experts say are in demand right now. And that is not the end; we provide world-class certifications and programs both brewed in-house or from our partner institutes/network that include world-class trainers such as Tony Robbins and so on. (Rahi Bhai to give relevant client portfolio)&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;&lt;b style=&quot;font-size: 2.5rem; font-family: var(--bs-font-sans-serif);&quot;&gt;Why onboarding with us?&lt;/b&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;In these challenging and uncertain times, the demand for learning from customers and stakeholders is growing exponentially. L&amp;amp;D professionals are finding they need to grow their own capability more rapidly than ever before to be able to meet the changing demands from learning consumers. Global Institute for Human Capital Development offers high caliber certification program curated for professionals to hone their skills and be fit for the future of the learning organization.&lt;br&gt;&lt;/p&gt;\r\n&lt;p&gt;&lt;/p&gt;&lt;p&gt;&lt;/p&gt;&lt;p&gt;&lt;/p&gt;&lt;/p&gt;', '');

